(9, 'Doctor Doofy', 'Max green - aiding and abbeting - 3/22/2024', '\n      <p style=\"color: white;\">\n          <p><strong>📝 Summary:</strong></p>\n          <p><em>[Insert Report Summary Here] we ran a 10-8 it turned into a 10-50 suspect ran on foot another car came to pick up the original supsect. the suspect we have in custody got out of the car to help his friend get away and i managed to catch the current suspect and bring hiom back to mrpd</em></p>\n          <p>&nbsp;</p>\n          <p><strong>🧍 Hostage:</strong> [Name Here]</p>\n          <p>&nbsp;</p>\n          <p><strong>🗄️ Evidence Location:</strong> Stash 3 | Drawer 55</p>\n          <p>&nbsp;</p>\n          <p><strong>🔪 Weapons/Items Confiscated:</strong></p>\n          <p><em>· 5 LOCKPICKS</em></p><p><br></p>\n          <p>&nbsp;</p>\n          <p>-----</p>\n          <p><strong style=\"background-color: var(--color-1);\">💸 Fine:125</strong></p>\n          <p>&nbsp;</p>\n          <p><strong>⌚ Sentence: TIME SERVED</strong></p>\n          <p>-----</p>\n      </p>\n  ', '[]', '[\"(124 B.Doofy) Doctor Doofy\",\"(123 r.squabble) Ronald Squabble\"]', '[]', '[]', '1711295699797', 'police'),
(10, 'Doctor Doofy', 'kei johnson - GTA and reckless driving - 3/23/24', '\n      <p style=\"color: white;\">\n          </p><p><strong>📝 Summary:</strong></p>\n          <p><em>Suspect was caught outfront of mrpd driving a stolen police truck and when we put our lights and sirens on trying to pull him over he proceeded to run and we continued to chase him till the vehicle broke down and we got into a footchase after that and finally caught him at the little seoul gas station.</em></p>\n          <p>&nbsp;</p>\n          <p><strong>🧍 Hostage:</strong> [Name Here]</p>\n          <p>&nbsp;</p>\n          <p><strong>🗄️ Evidence Location:</strong> Stash 3 | Drawer 56</p>\n          <p>&nbsp;</p>\n          <p><strong>🔪 Weapons/Items Confiscated:</strong></p>\n          <p><em>· baseball bat</em></p><p><span style=\"background-color: var(--color-1);\">&nbsp;lockpicks</span></p>\n          <p>-----</p>\n          <p><strong style=\"background-color: var(--color-1);\">💸 Fine:250</strong></p>\n          <p>&nbsp;</p>\n          <p><strong>⌚ Sentence:time served</strong></p>\n          <p>-----</p>\n      <p></p>\n  ', '[]', '[\"(169 Bubba Bush) Bubba Bush\",\"(124 B.Doofy) Doctor Doofy\"]', '[]', '[\"https://cdn.discordapp.com/attachments/1216632718989983784/1221256617660780675/image.png?ex=6611eadb&is=65ff75db&hm=6b0f30b00fd32708c3f45b058116185625299e29fa1085786e132d8af5fccbd1&\"]', '1711295684096', 'police'),
(11, 'Wilson Savile', 'Max Green - hostage taking x1,GTA, - 3/24/2024', '\n      <div style=\"color: white;\">\n          <p><strong>📝 Summary:</strong></p>\n          <p><em>We had an elert that a store robbery was in progress, when we arrived on scene we saw a hostage and 2 masked individuals (one being max green). after they handed over the hostage we chased them until they crashed and the car completely broke they then stole a cop car and they red engined that too. then we eventually cuaght max green on a foot chase.</em></p>\n          <p>&nbsp;</p>\n          <p><strong>🧍 Hostage:</strong> [Malia Kerr]</p>\n          <p>&nbsp;</p>\n          <p><strong>🗄️ Evidence Location:</strong> Stash 3 | Drawer 65</p>\n          <p><strong>🔪 Weapons/Items Confiscated:</strong></p>\n          <p>bat smashed bottle</p>\n          <p>&nbsp;</p>\n          <p>-----</p>\n          <p><strong style=\"background-color: var(--color-1);\">💸 Fine: $750</strong></p>\n          <p>&nbsp;</p>\n          <p><strong>⌚ Sentence: 10 months</strong></p>\n          <p>-----</p>\n      </div>\n  ', '[]', '[\"(110 Wilson Savile) Wilson Savile\",\"(123 r.squabble) Ronald Squabble\",\"(122 John Squabble) John  Squabble \",\"(111 Vincent Savile) Vincent Savile\"]', '[\"Malia  Kerr\"]', '[]', '1711295716780', 'police'),
(12, 'Tom Clark', 'Matt Pepperfield - Attemeted murder x2 and possesi', '\n      <p style=\"\">\n          </p><p style=\"color: white;\"><strong>📝 Summary:</strong></p>\n          <p style=\"\"><em style=\"\"><font color=\"#ffffff\">We were at PDM and the suspect shot at our vehicles and we got in to a 10-80, suspect was neutralized at dorest drive when his vehicle broke down and suspect was brought into custody. Suspects than broke into pd and broke out of the jail cells robbed us and took off. Kevin kash was one of criminals that came down to break out matt pepperfield.</font></em></p>\n          <p style=\"color: white;\">&nbsp;</p>\n          <p style=\"color: white;\"><strong>🧍 Hostage:</strong> [Name Here]</p>\n          <p style=\"color: white;\">&nbsp;</p>\n          <p style=\"color: white;\"><strong>🗄️ Evidence Location:</strong> Stash 3 | Drawer 655</p>\n          <p style=\"color: white;\">&nbsp;</p>\n          <p style=\"color: white;\"><strong>🔪 Weapons/Items Confiscated:</strong></p>\n          <p style=\"color: white;\"><em>· machate&nbsp;</em></p><p style=\"color: white;\"><em>m110</em></p><p style=\"color: white;\"><em>glock18c</em></p><p style=\"color: white;\"><em>handcuffs</em></p><p style=\"color: white;\"><em>acid</em></p>\n          <p style=\"color: white;\">&nbsp;</p>\n          <p style=\"color: white;\">-----</p>\n          <p style=\"color: white;\"><strong style=\"background-color: var(--color-1);\">💸 Fine:</strong></p>\n          <p style=\"color: white;\">&nbsp;</p>\n          <p style=\"color: white;\"><strong>⌚ Sentence: time served</strong></p>\n          <p style=\"color: white;\">-----</p>\n      \n  ', '[]', '[\"(992 - Clark) Tom Clark\",\"(124 B.Doofy) Doctor Doofy\",\"(123 r.squabble) Ronald Squabble\",\"(122 John Squabble) John  Squabble \"]', '[]', '[\"https://cdn.discordapp.com/attachments/1221499976228671608/1221515441508192296/image.png?ex=6612dbe7&is=660066e7&hm=88787d2e510900b1dc09135e86c30492f0952776296a1abf091b36fdd3