(13, 'Doctor Doofy', 'Kevin Kash - attempted murder leo x4 - 3/24/2024', '\n      <p style=\"color: white;\">\n          <p><strong>📝 Summary:</strong></p>\n          <p><span style=\"background-color: var(--color-1);\"><em>Suspect was caught at a suspect 911 call</em>&nbsp; and we had 2 officers pull up to ask him a few questions when he proceeded to run and get into a 10-80. Once he finally got the end of the peer on voodoo place we got into a shootout with 2 suspects the one got away and the other one was caught and arrested.</span><br></p>\n          <p><strong>🧍 Hostage:</strong> [Name Here]</p>\n          <p>&nbsp;</p>\n          <p><strong>🗄️ Evidence Location:</strong> Stash 3 | Drawer 866</p>\n          <p>&nbsp;</p>\n          <p><strong>🔪 Weapons/Items Confiscated:</strong></p>\n          <p><em>· pd glock</em></p><p><em>handcuffs</em></p><p><em>3 drug packages</em></p><p><em><br></em></p>\n          <p>&nbsp;</p>\n          <p>-----</p>\n          <p><strong style=\"background-color: var(--color-1);\">💸 Fine:0</strong></p>\n          <p>&nbsp;</p>\n          <p><strong>⌚ Sentence:295</strong></p>\n          <p>-----</p>\n      </p>\n  ', '[]', '[\"(124 B.Doofy) Doctor Doofy\",\"(123 r.squabble) Ronald Squabble\",\"(122 John Squabble) John  Squabble \",\"(169 Bubba Bush) Bubba Bush\"]', '[]', '[\"https://cdn.discordapp.com/attachments/1221499801758203964/1221636774376378388/image.png?ex=66134ce7&is=6600d7e7&hm=03c069966743c8537ab316b19497e05710cf1d78686e9a369ee151766203148c&\",\"https://cdn.discordapp.com/attachments/1221499801758203964/1221636347517866075/image.png?ex=66134c82&is=6600d782&hm=88012105f6aaac6ab6e5a2aa72d1566aff4859ed3e7b9ccb3be5ff0c2c7f3412&\",\"https://cdn.discordapp.com/attachments/1221499801758203964/1221636405734670386/image.png?ex=66134c90&is=6600d790&hm=082f30122f69a8813658d12ecebfec5059f922ea6c54f8e342ab0438882564c1&\",\"https://cdn.discordapp.com/attachments/1221499801758203964/1221636489922871346/image.png?ex=66134ca4&is=6600d7a4&