(40126, 'AUE55545', 1, 'license:8cb9f8548eb4c7764c77849cfa2ff397ec016f08', 'Mr_Green', '{\"cash\":589.0,\"crypto\":0,\"bank\":26665}', '{\"account\":\"US05QBCore5697379298\",\"firstname\":\"Tom\",\"backstory\":\"Dylan Clark\'s story begins in the heart of a small Swedish village. From the earliest fragments of his childhood memories, Dylan displayed an innate fascination with electronics, a passion that flowed from his parents who owned a humble electronics shop. While other younglings his age revealed in carefree play, Dylan was stuck in his room dismantling gadgets and reassembling them, in the process, he laid the foundations for the exceptional skills that would come to define him later.\\n\\nAmid the confines of this tight-knit Swedish community, the streets may have been quiet, but Dylan always dreamed of doing something bigger. His love for technology and gadgets was complemented by an equal fascination with speed. At a mere age of 15, Dylan\'s urge for driving secretly led him into the dark realm of underground street racing. It didn\'t take long for his exceptional talent behind the wheel to earn him a reputation among local racing enthusiasts.\\nOver the upcoming years he finished his studies with a degree in programming. He started off working as a Jr Programmer at a local company and with his skills and work ethic he quickly worked his way up, he seemed to have a good path in front of him. \\nYet, destiny had a different path in store for him. In his early twenties he got a job offer from a company that he had contact during his time at work. An oppurtunity that would drag him away from the familiarity of his hometown to the distant streets of London. The allure of the city was magnetic, but it was within the shadows of these chilly streets that Dylan would experience a profound transformation.\\nHe quickly found himself in the local streetracing scene, and his immaculate driving caught the attention of a local gang called The Nordics. Over the years he was a programmer by day and gang member at night and he worked himself up to becoming a leader for The Nordics. Under his guidance, this collective of kindred spirits gained notoriety. Dylan\'s unparalleled hacking skills, combined with his unparalleled prowess behind the wheel and a leadership style rooted in understanding and an unconventional leadership. The Nordics rapidly carve a formidable presence into the very fabric of London\'s streets. Their activities evolved seamlessly, transitioning from the heart-pounding excitement of subway races to the precision and meticulous planning of audacious heists.\\n\\nHowever, the journey of The Nordics took an unexpected turn. The very unity and close bonds that Dylan cherished would eventually become their downfall. A series of unfortunate events, magnified by a betrayal from one of their own, attracted the intense monitoring of British law enforcement. Faced with the danger and the potential consequences for his crew, Dylan was confronted with a heart-wrenching decision. He made the choice to disband The Nordics, leaving behind the streets that had once granted him power, respect, and a deep sense of belonging.\\n\\nConsidering he has to flee London he contacts an old associate. For the time being the friend lives the sun-soaked boulevards of Los Santos. Knowing what an asset Dylan could be for him, he gladly decided to help get Dylan across the world and into Los Santos. Dylan is a bit uneasy about the whole situation but the associates ensure that Los Santos is the place to go, with opportunities waiting around every corner. He decides to take the offer, but with the mindset to go clean and leave his life of crime behind and to get a fresh start.\",\"birthdate\":\"31/12/98\",\"gender\":0,\"cid\":1,\"nationality\":\"Sweden\",\"phone\":\"1596573174\",\"lastname\":\"Clark\"}', '{\"isboss\":false,\"grade\":{\"level\":2,\"name\":\"Senior officer\"},\"type\":\"leo\",\"label\":\"Law Enforcement\",\"name\":\"police\",\"payment\":575,\"onduty\":true}', '{\"label\":\"No Gang Affiliaton\",\"isboss\":false,\"grade\":{\"level\":0,\"name\":\"none\"},\"name\":\"none\"}', '{\"x\":745.2791137695313,\"y\":-1499.82861328125,\"z\":20.5347900390625}', '{\"status\":[],\"jailitems\":[],\"ishandcuffed\":false,\"fingerprint\":\"ur500C77nbT4895\",\"phonedata\":{\"InstalledApps\":[],\"SerialNumber\":35266079},\"communityservice\":0,\"hunger\":44.80000000000019,\"jobrep\":{\"trucker\":0,\"tow\":0,\"hotdog\":0,\"taxi\":0},\"isdead\":false,\"inside\":{\"apartment\":[]},\"callsign\":\"325 - Tom Clark\",\"armor\":0,\"stress\":0,\"phone\":[],\"injail\":0,\"illegalfishing\":0,\"criminalrecord\":{\"hasRecord\":false},\"fitbit\":[],\"attachmentcraftingrep\":0,\"craftingrep\":0,\"craftinglevel\":0,\"fishingrep\":0,\"magnetfishingrep\":0,\"inlaststand\":false,\"walletid\":\"QB-62024366\",\"tracker\":false,\"thirst\":55.14999999999971,\"dealerrep\":0,\"bloodtype\":\"AB+\",\"commandbinds\":[],\"licences\":{\"business\":false,\"driver\":true,\"weapon\":false}}', '[{\"type\":\"item\",\"info\":[],\"amount\":1,\"name\":\"phone\",\"slot\":1},{\"type\":\"item\",\"info\":[],\"amount\":1,\"name\":\"radio\",\"slot\":2},{\"type\":\"weapon\",\"info\":{\"ammo\":-1,\"quality\":100,\"serie\":\"20cSk6Ly925rmNE\"},\"amount\":1,\"name\":\"weapon_stungun\",\"slot\":3},{\"type\":\"weapon\",\"info\":{\"attachments\":[{\"component\":\"COMPONENT_AT_PI_FLSH\",\"label\":\"Flashlight\"}],\"ammo\":120,\"quality\":75.84999999999909,\"serie\":\"35sOP2tb825hpAi\"},\"amount\":1,\"name\":\"weapon_pistol\",\"slot\":4},{\"type\":\"item\",\"info\":[],\"amount\":1,\"name\":\"handcuffs\",\"slot\":5},{\"type\":\"item\",\"info\":{\"birthdate\":\"31/12/98\",\"type\":\"Class C Driver License\",\"firstname\":\"Tom\",\"lastname\":\"Clark\"},\"amount\":1,\"name\":\"driver_license\",\"slot\":6},{\"type\":\"item\",\"info\":{\"ps_image\":\"\\\"https://media.discordapp.net/attachments/1183103318004879471/1222690261998637146/screenshot.jpg?ex=6617220a&is=6604ad0a&