(53129, 'JDS47227', 1, 'license:1d3fcb4df8619570705a91f0605b8b262ec381e5', 'grimwrim', '{\"cash\":0,\"crypto\":0,\"bank\":5050}', '{\"birthdate\":\"15/06/01\",\"phone\":\"4788872975\",\"nationality\":\"Mexican\",\"lastname\":\"Lee\",\"firstname\":\"Grim\",\"account\":\"US05QBCore3208627757\",\"cid\":1,\"backstory\":\"Jay Lee was born and raised in a vibrant town nestled in the heart of Mexico. Growing up, he developed a deep love for a city called los santos and he always had a dream to go one day, Born into a family of skilled assassins, Jay\'s creativity and deadly skilled for assassin work were nurtured from a young age and learned from his brother.\\nHis parents owned a small house where they did assassin work to keep food on the table and . Jay would often spend hours observing his brother and learning methods of being a assassin but Jay wanting a life where he didn\'t have to kill people but just be a normal boy and his brother Tj Lee wanted the same life so when they turned 18 they moved from Mexico to los santos for a better life and then came a guy named Jimmy Pesto became friends and brothers at that and we shared a unique and dangerous occupation and that was assassin work\\n\\nThey decided to take him under their wing, introducing him to their world of shadows, secrets, and danger. and helped developed his skills in stealth, combat, and tactical planning and then one day They navigated the treacherous underworld, taking contracts from powerful and influential individuals who sought their unique .\\n\\nBut after years of living as assassins, Jimmy, Jay, and T.J. realized that the thrill and excitement they once found in their profession had faded away. It had stopped being fun. The constant danger and moral compromises had taken a toll on their spirits. They longed for a simpler, more fulfilling life that didn\'t involve violence and deception. With heavy hearts, they collectively decided to abandon their assassin lifestyle and seek a path that brought them genuine happiness and inner peace. It was a brave choice to prioritize their well-being and pursue a life that resonated with their true selves.\",\"gender\":0}', '{\"grade\":{\"name\":\"Freelancer\",\"level\":0},\"payment\":10,\"label\":\"Civilian\",\"name\":\"unemployed\",\"isboss\":false,\"onduty\":true,\"type\":\"none\"}', '{\"grade\":{\"name\":\"none\",\"level\":0},\"isboss\":false,\"name\":\"none\",\"label\":\"No Gang Affiliaton\"}', '{\"x\":122.96703338623047,\"y\":-223.66152954101563,\"z\":54.5545654296875}', '{\"stress\":0,\"inside\":{\"apartment\":[]},\"fishingrep\":0,\"criminalrecord\":{\"hasRecord\":false},\"magnetfishingrep\":0,\"phonedata\":{\"InstalledApps\":[],\"SerialNumber\":55231208},\"hunger\":83.60000000000017,\"armor\":0,\"dealerrep\":0,\"injail\":0,\"phone\":[],\"inlaststand\":false,\"attachmentcraftingrep\":0,\"bloodtype\":\"A-\",\"illegalfishing\":0,\"jailitems\":[],\"jobrep\":{\"taxi\":0,\"tow\":0,\"hotdog\":0,\"trucker\":0},\"isdead\":false,\"communityservice\":0,\"callsign\":\"NO CALLSIGN\",\"fitbit\":[],\"ishandcuffed\":false,\"commandbinds\":[],\"thirst\":62.29999999999969,\"fingerprint\":\"NE868w42buv2799\",\"craftinglevel\":0,\"craftingrep\":0,\"tracker\":false,\"walletid\":\"QB-30051587\",\"licences\":{\"weapon\":false,\"business\":false,\"driver\":true},\"status\":[]}', '[{\"name\":\"sandwich\",\"slot\":1,\"amount\":2,\"type\":\"item\",\"info\":[]},{\"name\":\"phone\",\"slot\":2,\"amount\":1,\"type\":\"item\",\"info\":[]},{\"name\":\"lockpick\",\"slot\":3,\"amount\":5,\"type\":\"item\",\"info\":[]},{\"name\":\"water_bottle\",\"slot\":4,\"amount\":5,\"type\":\"item\",\"info\":[]},{\"name\":\"scorcher\",\"slot\":5,\"amount\":1,\"type\":\"item\",\"info\":{\"pearlescentColor\":0,\"xenonColor\":0,\"colorPrimary\":0,\"wheelColor\":0,\"colorSecondary\":0,\"plate\":\"BICYCLE5\"}},{\"name\":\"id_card\",\"slot\":11,\"amount\":1,\"type\":\"item\",\"info\":{\"nationality\":\"Mexican\",\"lastname\":\"Lee\",\"firstname\":\"Grim\",\"citizenid\"