(82880, 'RQS72045', 2, 'license:8cb9f8548eb4c7764c77849cfa2ff397ec016f08', 'Mr_Green', '{\"crypto\":0,\"cash\":250,\"bank\":4300}', '{\"phone\":\"5396175357\",\"account\":\"US09QBCore3716658648\",\"firstname\":\"Dylan\",\"gender\":0,\"backstory\":\"Dylan Clark\'s story begins in the heart of a small Swedish village. From the earliest fragments of his childhood memories, Dylan displayed an innate fascination with electronics, a passion that flowed from his parents who owned a humble electronics shop. While other younglings his age revealed in carefree play, Dylan was stuck in his room dismantling gadgets and reassembling them, in the process, he laid the foundations for the exceptional skills that would come to define him later.\\n\\nAmid the confines of this tight-knit Swedish community, the streets may have been quiet, but Dylan always dreamed of doing something bigger. His love for technology and gadgets was complemented by an equal fascination with speed. At a mere age of 15, Dylan\'s urge for driving secretly led him into the dark realm of underground street racing. It didn\'t take long for his exceptional talent behind the wheel to earn him a reputation among local racing enthusiasts.\\nOver the upcoming years he finished his studies with a degree in programming. He started off working as a Jr Programmer at a local company and with his skills and work ethic he quickly worked his way up, he seemed to have a good path in front of him. \\nYet, destiny had a different path in store for him. In his early twenties he got a job offer from a company that he had contact during his time at work. An oppurtunity that would drag him away from the familiarity of his hometown to the distant streets of London. The allure of the city was magnetic, but it was within the shadows of these chilly streets that Dylan would experience a profound transformation.\\nHe quickly found himself in the local streetracing scene, and his immaculate driving caught the attention of a local gang called The Nordics. Over the years he was a programmer by day and gang member at night and he worked himself up to becoming a leader for The Nordics. Under his guidance, this collective of kindred spirits gained notoriety. Dylan\'s unparalleled hacking skills, combined with his unparalleled prowess behind the wheel and a leadership style rooted in understanding and an unconventional leadership. The Nordics rapidly carve a formidable presence into the very fabric of London\'s streets. Their activities evolved seamlessly, transitioning from the heart-pounding excitement of subway races to the precision and meticulous planning of audacious heists.\\n\\nHowever, the journey of The Nordics took an unexpected turn. The very unity and close bonds that Dylan cherished would eventually become their downfall. A series of unfortunate events, magnified by a betrayal from one of their own, attracted the intense monitoring of British law enforcement. Faced with the danger and the potential consequences for his crew, Dylan was confronted with a heart-wrenching decision. He made the choice to disband The Nordics, leaving behind the streets that had once granted him power, respect, and a deep sense of belonging.\\n\\nConsidering he has to flee London he contacts an old associate. For the time being the friend lives the sun-soaked boulevards of Los Santos. Knowing what an asset Dylan could be for him, he gladly decided to help get Dylan across the world and into Los Santos. Dylan is a bit uneasy about the whole situation but the associates ensure that Los Santos is the place to go, with opportunities waiting around every corner. He decides to take the offer, but with the mindset to go clean and leave his life of crime behind and to get a fresh start.\",\"nationality\":\"Swedish\",\"cid\":2,\"lastname\":\"Clark\",\"birthdate\":\"11/02/01\"}', '{\"payment\":1000,\"grade\":{\"name\":\"Crew Member\",\"level\":1},\"isboss\":false,\"type\":\"none\",\"label\":\"Uwu Cafe\",\"name\":\"uwu\",\"onduty\":true}', '{\"grade\":{\"name\":\"none\",\"level\":0},\"label\":\"No Gang Affiliaton\",\"name\":\"none\",\"isboss\":false}', '{\"x\":-585.8637084960938,\"y\":-1060.1142578125,\"z\":22.3377685546875}', '{\"ishandcuffed\":false,\"jailitems\":[],\"callsign\":\"NO CALLSIGN\",\"craftinglevel\":0,\"bloodtype\":\"B-\",\"illegalfishing\":0,\"thirst\":70.09999999999974,\"commandbinds\":[],\"licences\":{\"driver\":true,\"weapon\":false,\"business\":false},\"isdead\":false,\"inside\":{\"apartment\":[]},\"attachmentcraftingrep\":0,\"dealerrep\":0,\"fishingrep\":0,\"magnetfishingrep\":0,\"phonedata\":{\"SerialNumber\":24166600,\"InstalledApps\":[]},\"stress\":0,\"status\":[],\"armor\":0,\"tracker\":false,\"hunger\":63.20000000000013,\"inlaststand\":false,\"craftingrep\":0,\"fitbit\":[],\"injail\":0,\"criminalrecord\":{\"hasRecord\":false},\"walletid\":\"QB-98380263\",\"jobrep\":{\"trucker\":0,\"hotdog\":0,\"taxi\":0,\"tow\":0},\"fingerprint\":\"lt518J22lQy6344\",\"phone\":[],\"communityservice\":0}', '[{\"type\":\"item\",\"slot\":1,\"name\":\"scorcher\",\"amount\":1,\"info\":{\"wheelColor\":0,\"xenonColor\":0,\"pearlescentColor\":0,\"colorSecondary\":0,\"colorPrimary\":0,\"plate\":\"BICYCLE5\"}},{\"type\":\"item\",\"slot\":2,\"name\":\"radio\",\"amount\":1,\"info\":[]},{\"type\":\"item\",\"slot\":3,\"name\":\"lockpick\",\"amount\":5,\"info\":[]},{\"type\":\"item\",\"slot\":4,\"name\":\"sake\",\"amount\":5,\"info\":[]},{\"type\":\"item\",\"slot\":6,\"name\":\"phone\",\"amount\":1,\"info\":[]},{\"type\":\"item\",\"slot\":7,\"name\":\"water_bottle\",\"amount\":5,\"info\":[]},{\"type\":\"item\",\"slot\":8,\"name\":\"ramen\",\"amount\":5,\"info\":[]},{\"type\":\"item\",\"slot\":9,\"name\":\"detector\",\"amount\":1,\"info\":{\"quality\":100}},{\"type\":\"item\",\"slot\":12,\"name\":\"sandwich\",\"amount\":5,\"info\":[]},{\"type\":\"item\",\"slot\":18,\"name\":\"driver_license\",\"amount\":1,\"info\":{\"type\":\"Class C Driver License\",\"firstname\":\"Dylan\",\"lastname\":\"Cla