(102131, 'WJJ72340', 1, 'license:54a6c7eec11a9fb20bc62541c4e0c0e5662c273e', 'Kiko ', '{\"bank\":5000,\"crypto\":0,\"cash\":500}', '{\"cid\":1,\"phone\":\"6901243972\",\"gender\":1,\"lastname\":\"Gorka\",\"firstname\":\"Kiko\",\"nationality\":\"white\",\"backstory\":\"Kiko grew up acclimated too the ways of the world and how too survive in it from a young age. \\nHer father struggled to maintain societal norm jobs due to his criminal past involving charges ranging from armed robbery too solicitation of drugs and weapons, he grew up rough, in a poor neighbor hood, doing what he could too get by but the repercussions of his youth made it hard too change the lifestyle and means of income he knew to a more societally appropriated one, in such most of kikos childhood growing up he was in and out alot at times he\'d be gone for days even weeks at a time as too not put his family at risk after joining a gang within the city.\\nKiko\'s mother who raised her most of her childhood when her father was away, was too her core a sweet woman and a recovered addict who stayed at home to take care of kiko and the house, due to the neighborhood they lived in kiko was homeschooled. Her parents attempted the local public schools but removed kiko her first year of high school after she was attacked by a group of girls that had been relentlessly bullying her for the fact she had been a slightly socially awkward high-school girl and well bullies are bullies, the fight put kiko in the hospital with 2 broken ribs, a concussion, and a fractured jaw. \\nUpon being homeschooling kiko began doing as many teenagers do and lashing out. Sneaking out at night to go to parties and hang out with friends from around the block.\\nKiko firmly believed growing up that getting\\nHer and her family out of the poor crime ridden neighborhood would fix all her problems and too do such she needed money, so money quickly became kikos main and only goal. \\n \\nBy the age of 18 kikos parents lives had slowed and normalized, her mother worked day shift at the corner store while her father worked at the local factory after having left the gang and criminal lifestyle, that unknown too him his daughter had picked up. \\nKiko had began acclimating herself into gang activity, robberies, drive bys, soliciting weaponry, etc, growing quickly addicted to the thrill of the lifestyle her parents tried to keep her from and get away from themselves.\\nBy 21 kiko had been in and out of jail for multiple robberies and assaults, her father pleaded and pressed her that the gang life was no life too live but she didn\'t care and further rebelled. \\nOne monday night kiko and her mother and father were having dinner talking of their day and such amongst one another like the did every Monday as kikos mother made it a point too do since she was young so they all spent at least one night a week together maintaining the tight nit family bond over the years, in a flash kikos life changed.\\nLoud bangs broke the air followed by shattering glass, as kiko looked up red sprayed across the table as flying bullets passed through her father whom was sitting across from her mother, catching the bullets too follow after kikos fathers body slumped forward, her mother\'s quickly following suit.\\nInstinctual kikos body dropped to the floor her hands over her head as the loud pops of guns and smell of blood fill the air around her.\\nLooking up as she felt the vibrations of weight hitting the ground her eyes locked to her parents dead bodies slumped on the floor, a loud tire squeal was all she heard before everything grew still and her world shattered.\\n\\nKiko snapped and was immediately ready for war, she went too her gang to figure out who did it and to get them back but upon doing so found out it was her own gang that gave her up to the current one in which they had beef with, putting all blame on her and telling them if they\'d squash it they\'d give her up since they put blame to her name.\\nFinding this out pressed her even further, over the course of of the next 2 years kiko became recluse, the police knowing her prior record chucked it up as a gang related shooting and gave little effort or care too bring justice, so she strategically and patiently planned and prepped her own.\\nOn the anniversary of the 3rd year of her parents passing she set her plan to motion.\\n\\nOver these years of plan and prepping, since she knew the turf of her gang and the fact kiko grew up in the streets she lived her whole life, so laying pipe bombs through out each gangs turf and within their hide outs came easier than not, unlike her father it seemed her criminal childhood almost benefitted her at this point.\\nLaying mics and a camera in each gangs turf she simply sat and waited for the right moment, patiently.\\nWhen right and each gangs turf was littered in their own kind, her moment she\'d so desperately worked for finally came, typing in a few codes to her laptop and a final click caused the beginning of what soundes like a symphony of explosions one on the north end of town and one south west, following rapidly by sirens.\\n\\nImmediately after kiko grabbed the bug out bag she had prepped amongst the years as well, kissed the photo she had of her parents before setting it on the table turning on the gas too the stove and walking out the door. \\nAs she pulled out of her driveway and far enough across the road on her bike she stopped, pulled her gun, and gave one shot into the house.\\nShe watched for a few minutes before finally driving off.\\n\\nOver the course of the years too follow she\'s been traveling cross country in search of somewhere too make new where she won\'t be recognized and can make a name for herself the way she feels she should, no matter where that path may lead.\\nHearing of Los Santos one day in a city she made a stop too sleep she decided thats where she would head next.\",\"account\":\"US01QBCore2796445563\",\"birthdate\":\"26/07/95\"}', '{\"name\":\"unemployed\",\"type\":\"none\",\"label\":\"Civilian\",\"payment\":10,\"grade\":{\"name\":\"Freelancer\",\"level\":0},\"onduty\":false,\"isboss\":false}', '{\"name\":\"none\",\"isboss\":false,\"grade\":{\"name\":\"none\",\"level\":0},\"label\":\"No Gang Affiliaton\"}', '{\"x\":-1287.032958984375,\"y\":-438.5142822265625,\"z\":6.195556640625}', '{\"thirst\":70.74999999999975,\"armor\":0,\"inlaststand\":false,\"licences\":{\"weapon\":false,\"business\":false,\"driver\":true},\"hunger\":64.00000000000013,\"attachmentcraftingrep\":0,\"fitbit\":[],\"bloodtype\":\"A+\",\"illegalfishing\":0,\"craftinglevel\":0,\"jobrep\":{\"trucker\":0,\"taxi\":0,\"hotdog\":0,\"tow\":0},\"callsign\":\"NO CALLSIGN\",\"commandbinds\":[],\"currentapartment\":\"apartment21148\",\"injail\":0,\"magnetfishingrep\":0,\"status\":[],\"fingerprint\":\"ja208y53FdR5203\",\"dealerrep\":0,\"tracker\":false,\"phonedata\":{\"InstalledApps\":[],\"SerialNumber\":33628779},\"communityservice\":0,\"stress\":0,\"walletid\":\"QB-45933825\",\"craftingrep\":0,\"jailitems\":[],\"ishandcuffed\":false,\"fishingrep\":0,\"isdead\":false,\"criminalrecord\":{\"hasRecord\":false},\"phone\":[],\"inside\":{\"apartment\":{\"apartmentType\":\"apartment2\",\"apartmentId\":\"apartment21148\"}}}', '[{\"name\":\"scorcher\",\"slot\":1,\"info\":{\"wheelColor\":0,\"xenonColor\":0,\"pearlescentColor\":0,\"colorSecondary\":0,\"plate\":\"BICYCLE8\",\"colorPrimary\":0},\"type\":\"item\",\"amount\":1},{\"name\":\"driver_license\",\"slot\":2,\"info\":{\"lastname\":\"Gorka\",\"birthdate\":\"26/07/95\",\"type\":\"Class C Driver License\",\"firstname\":\"Kiko\"},\"type\":\"item\",\"amount\":1},{\"name\":\"id_card\",\"slot\":3,\"info\":{\"birthdate\":\"26/07/95\",\"nationality\":\"white\",\"citizenid\":\"WJJ72340\",\"firstname\":\"Kiko\",\"gender\":1,\"lastname\":\"Gorka\"},\"type\":\"item\",\"amount\":1},{\"name\":\"sandwich\",\"slot\":4,\"info\":[],\"type\":\"item\",\"amount\":5},{\"name\":\"lockpick\",\"slot\":5,\"info\":[],\"type\":\"item\